function calcPos(){
  $('.widget-svg g').each(function(index) {
    // Get the <g> element
    var $g = $(this);
    var h = $(this).closest('.widget-img').height()
  
    console.log(h)
    // Get the bounding box of the <g> element
    var bbox = $g[0].getBBox();
  
    if (window.innerWidth > 768){
      var centerX = (bbox.x / 3413 * h) + (bbox.width  / 3413 * h ) / 2;
      var centerY = (bbox.y / 3413 * h) + (bbox.height  / 3413 * h) / 2;
    }
    else{
      var centerX = (bbox.x / 3413 * h) + (bbox.width / 3413 * h) / 2;
      var centerY = (bbox.y / 3413 * h) + (bbox.height / 3413 * h) / 2;
  
      // Calculate bottom-right corner with 10px padding
      var centerX  = centerX + (bbox.width / 3413 * h) / 2;
      var centerY = centerY + (bbox.height / 3413 * h) / 2;
    }
    // Calculate the center of the <g> element
  
  
    // Find the corresponding widget-num div
    var $widgetNum = $('.widget-num').eq(index);
  
    // Set the position of the widget-num div
    $widgetNum.css({
        'position': 'absolute',
        'left': centerX + 'px',
        'top': centerY + 'px',
         // Center the div on the point
    });
  });
}



